    playbackData.comments = {"ev-1476":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-1476","timestamp":1662345184608,"createdByDevGroupId":"devGroupId-0","eventSequenceNumber":1476,"permanentRelevance":"never relevant","type":"INSERT","fileId":"fileId-5","character":"NEWLINE","previousNeighborId":"ev-1475","lineNumber":1,"column":15,"pastedEventId":null},"developerGroupId":"devGroupId-1","timestamp":1662345184613,"commentText":"<a href=\"https://hexdocs.pm/mix/Mix.html\">Mix</a> is a build tool for \nElixir. It brings together different modules and allows them to be \nexecuted together. It also bundles up your&nbsp;Elixir code so that it can be\n executed by others.<br><br>You can execute your code by specifying a file to run, using a tool called <span style=\"font-family: Courier;\">iex</span> (an interactive shell for Elixir), or by writing tests.<br><br><div>When you want to use libraries written by others, Mix will manage your dependencies.&nbsp;Many\n other languages and frameworks have similar systems. Node, for example,\n has the Node Package manager (npm). This is a place for \npeople to share their javascript libraries with each other.&nbsp;When\n a library is updated, Mix can get the latest and greatest updates so \nyour code can use them.&nbsp;</div><div><br></div><div>Erlang and Elixir have a package manager called <a href=\"https://hex.pm\">hex</a>.&nbsp;I will use it to get a JSON package at the end of this program.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-3","selectedText":"Part1.MixProject","startRow":0,"startColumn":10,"endRow":0,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"defmodule Part1.MixProject do","commentTags":[],"questionCommentData":null},{"id":"commentId-1","displayCommentEvent":{"id":"ev-1476","timestamp":1662345184608,"createdByDevGroupId":"devGroupId-0","eventSequenceNumber":1476,"permanentRelevance":"never relevant","type":"INSERT","fileId":"fileId-5","character":"NEWLINE","previousNeighborId":"ev-1475","lineNumber":1,"column":15,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662345297841,"commentText":"<div>The Mix tool creates a new directory to hold all of the source code \nand project resources.&nbsp;The resources include the output of \ncompiling Elixir code, project configuration information, copies of\n dependencies, and more. The Mix tool manages all of this and provides a\n relatively simple interface for working with Elixir code.<br></div><br>To\n create a Mix project, move to a directory where you want the tool to \ncreate this new Mix project directory and execute this command:<br><br><span style=\"font-family: Courier;\">mix new &lt;your_project_name&gt;</span><br><br><div>The\n tool will create a new directory that is the same as the project name \nyou specified.&nbsp;</div><div><br></div><div>I moved to a directory called <span style=\"font-family: Courier;\">code</span> and then I created \na Mix project called <span style=\"font-family: Courier;\">part1</span> like this:<br></div><br><span style=\"font-family: Courier;\">mix new part1</span><br><br><div>Then I moved into the new <span style=\"font-family: Courier;\">part1</span> directory like this:</div><div><br></div><div><span style=\"font-family: Courier;\">cd part1</span></div><div><br></div><div>The attached screenshot shows the output of running the command.&nbsp;On the \nleft hand side of the screenshot you can also see the new files and \nsubdirectories that were created.&nbsp;</div><div><br></div><div>You can also see the file system view \nby clicking the 'File System' tab above.</div>","commentTitle":"Creating a Mix Project","selectedCodeBlocks":[],"imageURLs":["media/images/1662345313128-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/test/test_helper.exs","viewableBlogText":"","commentTags":["image"],"questionCommentData":null},{"id":"commentId-2","displayCommentEvent":{"id":"ev-1476","timestamp":1662345184608,"createdByDevGroupId":"devGroupId-0","eventSequenceNumber":1476,"permanentRelevance":"never relevant","type":"INSERT","fileId":"fileId-5","character":"NEWLINE","previousNeighborId":"ev-1475","lineNumber":1,"column":15,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662345357965,"commentText":"<div>A Mix project includes several different files and directories. One important file is <span style=\"font-family: Courier;\">mix.exs</span>. This file holds configuration information about the project in a module starting with the project name, <span style=\"font-family: Courier;\">Part1</span>. I'll come back to this file later in the program.<br></div><div><br></div><div>The two most important directories created are called <span style=\"font-family: Courier;\">lib</span> and <span style=\"font-family: Courier;\">test</span>.<br></div>","commentTitle":"The Mix Project","selectedCodeBlocks":[{"fileId":"fileId-3","selectedText":"Part1.MixProject","startRow":0,"startColumn":10,"endRow":0,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/test/test_helper.exs","viewableBlogText":"defmodule Part1.MixProject do","commentTags":[],"questionCommentData":null}],"ev-1933":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-1933","timestamp":1662345465931,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1933,"type":"INSERT","fileId":"fileId-6","character":"NEWLINE","previousNeighborId":"ev-1932","lineNumber":20,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662345522699,"commentText":"<div class=\"commentText\"><div><div>The <span style=\"font-family: Courier;\">lib</span> directory is \nwhere you the put the source code in a Mix project.&nbsp;There is usually one module per file.</div><div><br></div><div>If you look at the \nattached screenshot or the file system tab above you can see that I \ncreated a subdirectory in <span style=\"font-family: Courier;\">lib</span> with the same name as the project, <span style=\"font-family: Courier;\">part1</span>.&nbsp;<br></div><div><br></div>I added the code from a module in a previous program to the Mix project, <span style=\"font-family: Courier;\">NameFormatter</span>.&nbsp;I added the <span style=\"font-family: Courier;\">NameFormatter</span> module but preceded the name with an uppercase version of the project name, <span style=\"font-family: Courier;\">Part1</span>, and a dot.</div><div><br></div><div>For the file names I use all lowercase letters with words separated by underscores. This file, for example, is called <span style=\"font-family: Courier;\">name_formatter.ex</span>.<br></div></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"Part1.NameFormatter","startRow":0,"startColumn":10,"endRow":0,"endColumn":29}],"imageURLs":["media/images/1662353054925-12.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":19,"currentFilePath":"/lib/part1/name_formatter.ex","viewableBlogText":"defmodule Part1.NameFormatter do\n  def format(\"John\", middle, last) do\n    \"#{last}, John (Jack) #{String.first(middle)}.\"\n  end\n\n  def format(\"Robert\", middle, last) do\n    \"#{last}, Robert (Bob) #{String.first(middle)}.\"\n  end\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\n\n  def format(first, last) do\n    \"#{last}, #{first}\"\n  end\n\n  def format(sole_name) do\n    \"The one and only #{sole_name}\"\n  end\nend","commentTags":["image"],"questionCommentData":null},{"id":"commentId-4","displayCommentEvent":{"id":"ev-1933","timestamp":1662345465931,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1933,"type":"INSERT","fileId":"fileId-6","character":"NEWLINE","previousNeighborId":"ev-1932","lineNumber":20,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662345562833,"commentText":"<div>The source code files in a Mix project end with a <span style=\"font-family: Courier;\">.ex</span> extension instead of <span style=\"font-family: Courier;\">.exs</span>.&nbsp;</div><div><br></div><div>Recall that <span style=\"font-family: Courier;\">.exs</span> files are similar to scripts that are interpreted at runtime. This can lead to slower execution times.</div><div><br></div><div>Elixir code can also be compiled to speed up its execution.&nbsp;<span style=\"font-family: Courier;\">.ex</span> files are compiled and the resulting <span style=\"font-family: Courier;\">.beam</span> files are stored in the Mix project's <span style=\"font-family: Courier;\">_build</span> folder.&nbsp;The Erlang VM executes <span style=\"font-family: Courier;\">.beam</span> files. (I am leaving the <span style=\"font-family: Courier;\">_build</span> folder out of this playback).</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"Part1.NameFormatter","startRow":0,"startColumn":10,"endRow":0,"endColumn":29}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/lib/part1/name_formatter.ex","viewableBlogText":"defmodule Part1.NameFormatter do","commentTags":[],"questionCommentData":null}],"ev-2478":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-2478","timestamp":1662345659216,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2478,"type":"INSERT","fileId":"fileId-6","character":")","previousNeighborId":"ev-2477","lineNumber":38,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662345914201,"commentText":"<div>Right now I have one module with some public functions in it.&nbsp;There are a few different ways to execute the code in a Mix project.&nbsp;</div><div><br></div><div>The first is to specify the name of a file that has some code in it. The highlighted code prints out some results from the module.</div><div><br></div><div>The command is:</div><div><br></div><div><span style=\"font-family: Courier;\">mix run &lt;file_path&gt;</span></div><div><br></div><div>(see the attached screenshot).<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"formatted_name = Part1.NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"John\", \"Fitzgerald\", \"Kennedy\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Robert\", \"Francis\", \"Kennedy\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Jack\", \"Kerouak\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Prince\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Cher\")\nIO.puts(formatted_name)","startRow":21,"startColumn":0,"endRow":37,"endColumn":23}],"imageURLs":["media/images/1662345931264-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/lib/part1/name_formatter.ex","viewableBlogText":"formatted_name = Part1.NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"John\", \"Fitzgerald\", \"Kennedy\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Robert\", \"Francis\", \"Kennedy\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Jack\", \"Kerouak\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Prince\")\nIO.puts(formatted_name)\n\nformatted_name = Part1.NameFormatter.format(\"Cher\")\nIO.puts(formatted_name)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-3524":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-3524","timestamp":1662345840015,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":3524,"type":"DELETE","fileId":"fileId-6","character":" ","previousNeighborId":"ev-3028","lineNumber":20,"column":1},"developerGroupId":"devGroupId-2","timestamp":1662345972486,"commentText":"<div>Another option is to use the tool, <span style=\"font-family: Courier;\">iex</span>. <span style=\"font-family: Courier;\">iex</span> is the Elixir interactive shell. When you start the <span style=\"font-family: Courier;\">iex</span> tool in a Mix project all of the modules are loaded into the VM and are accessible.</div><div><br></div><div>Then you can call functions from any of the modules. On line 21 I create a function with some similar code to the last version inside the <span style=\"font-family: Courier;\">NameFormatter</span> module. I'll use this to run some selected code.<br></div><div><br></div><div>This is how to start <span style=\"font-family: Courier;\">iex</span> in a Mix project: <br></div><div><br></div><div><span style=\"font-family: Courier;\">iex -S mix</span></div><div><br></div><div>Then I run the main function like this:</div><div><br></div><div><span style=\"font-family: Courier;\">Part1.NameFormatter.main()</span><br><br></div><div>The attached screenshots show how I start&nbsp;<span style=\"font-family: Courier;\">iex</span>, how I call the function, and the output of the program.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"def main() do\n    formatted_name = format(\"Mark\", \"Robert\", \"Mahoney\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"John\", \"Fitzgerald\", \"Kennedy\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Robert\", \"Francis\", \"Kennedy\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Jack\", \"Kerouak\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Prince\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Cher\")\n    IO.puts(formatted_name)\n  end","startRow":20,"startColumn":2,"endRow":38,"endColumn":5}],"imageURLs":["media/images/1662345966531-03.png","media/images/1662345966531-04.png","media/images/1662345966531-05.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/lib/part1/name_formatter.ex","viewableBlogText":"  def main() do\n    formatted_name = format(\"Mark\", \"Robert\", \"Mahoney\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"John\", \"Fitzgerald\", \"Kennedy\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Robert\", \"Francis\", \"Kennedy\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Jack\", \"Kerouak\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Prince\")\n    IO.puts(formatted_name)\n\n    formatted_name = format(\"Cher\")\n    IO.puts(formatted_name)\n  end","commentTags":["image"],"questionCommentData":null}],"ev-4270":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-4270","timestamp":1662346994426,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":4270,"type":"INSERT","fileId":"fileId-7","character":"NEWLINE","previousNeighborId":"ev-4269","lineNumber":21,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662347050928,"commentText":"<div>Perhaps a better way to test this code is to write some unit tests. Elixir comes with a unit test case framework called <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/ex_unit/main/ExUnit.html\">ExUnit</a></span>.</div><div><br></div><div>Unit tests are typically held in a special module associated with the one under test. Here I create <span style=\"font-family: Courier;\">NameFormatterTest</span> in a file called <span style=\"font-family: Courier;\">name_formatter_test.exs</span>. This file goes in Mix's <span style=\"font-family: Courier;\">test</span> directory (see the 'File System' tab above).&nbsp;</div><div><br></div><div>Follow this pattern for all of your tests.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"NameFormatterTest","startRow":0,"startColumn":10,"endRow":0,"endColumn":27}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/test/name_formatter_test.exs","viewableBlogText":"defmodule NameFormatterTest do","commentTags":[],"questionCommentData":null},{"id":"commentId-10","displayCommentEvent":{"id":"ev-4270","timestamp":1662346994426,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":4270,"type":"INSERT","fileId":"fileId-7","character":"NEWLINE","previousNeighborId":"ev-4269","lineNumber":21,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662350802965,"commentText":"<div><span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Kernel.html#use/2\">use</a></span> is a function to access code in another module (<span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Kernel.SpecialForms.html#import/2\">import</a></span> is another function to access code in another module). </div><div><br></div><div>Here I am using some code&nbsp;in the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/ex_unit/main/ExUnit.Case.html\">ExUnit.Case</a></span> module to define test cases.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"use ExUnit.Case","startRow":1,"startColumn":2,"endRow":1,"endColumn":17}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/test/name_formatter_test.exs","viewableBlogText":"  use ExUnit.Case","commentTags":[],"questionCommentData":null},{"id":"commentId-11","displayCommentEvent":{"id":"ev-4270","timestamp":1662346994426,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":4270,"type":"INSERT","fileId":"fileId-7","character":"NEWLINE","previousNeighborId":"ev-4269","lineNumber":21,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662351204290,"commentText":"<div>Here I use the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/ex_unit/main/ExUnit.Case.html#test/1\">test</a></span> function to test some functions from the <span style=\"font-family: Courier;\">Part1.NameFormatter</span> module.</div><div><br></div><div>I use the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/ex_unit/main/ExUnit.Assertions.html#assert/1\">assert</a></span> function to compare an expected value with an actual value. If all of the asserts evaluate to true then the test passes. If even one of them evaluates to false then the test fails.</div><div><br></div><div>The attached screenshot shows that I can run the tests with this command:</div><div><br></div><div><span style=\"font-family: Courier;\">mix test</span></div><div><br></div><div>It also shows that all the tests in the Mix project have passed.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"test \"Format a typical 3 part name\" do\n    assert(Part1.NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\") == \"Mahoney, Mark R.\")\n  end\n\n  test \"Format a 2 part name\" do\n    assert(Part1.NameFormatter.format(\"Jack\", \"Kerouac\") == \"Kerouac, Jack\")\n  end\n\n  test \"Format a 1 part name\" do\n    assert(Part1.NameFormatter.format(\"Prince\") == \"The one and only Prince\")\n    assert(Part1.NameFormatter.format(\"Cher\") == \"The one and only Cher\")\n  end\n\n  test \"Format colloquial names\" do\n    assert(Part1.NameFormatter.format(\"John\", \"Fitzgerald\", \"Kennedy\") == \"Kennedy, John (Jack) F.\")\n    assert(Part1.NameFormatter.format(\"Robert\", \"Francis\", \"Kennedy\") == \"Kennedy, Robert (Bob) F.\")\n  end","startRow":3,"startColumn":2,"endRow":19,"endColumn":5}],"imageURLs":["media/images/1662351185684-06.png"],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":1,"currentFilePath":"/test/name_formatter_test.exs","viewableBlogText":"defmodule NameFormatterTest do\n  use ExUnit.Case\n\n  test \"Format a typical 3 part name\" do\n    assert(Part1.NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\") == \"Mahoney, Mark R.\")\n  end\n\n  test \"Format a 2 part name\" do\n    assert(Part1.NameFormatter.format(\"Jack\", \"Kerouac\") == \"Kerouac, Jack\")\n  end\n\n  test \"Format a 1 part name\" do\n    assert(Part1.NameFormatter.format(\"Prince\") == \"The one and only Prince\")\n    assert(Part1.NameFormatter.format(\"Cher\") == \"The one and only Cher\")\n  end\n\n  test \"Format colloquial names\" do\n    assert(Part1.NameFormatter.format(\"John\", \"Fitzgerald\", \"Kennedy\") == \"Kennedy, John (Jack) F.\")\n    assert(Part1.NameFormatter.format(\"Robert\", \"Francis\", \"Kennedy\") == \"Kennedy, Robert (Bob) F.\")\n  end\nend","commentTags":["all-tests-pass","image"],"questionCommentData":null}],"ev-4295":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-4295","timestamp":1662347387276,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":4295,"type":"INSERT","fileId":"fileId-3","character":"}","previousNeighborId":"ev-4294","lineNumber":24,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662347447588,"commentText":"<div>Next, I want to add some functionality to the <span style=\"font-family: Courier;\">NameFormatter</span> module to write the formatted names to a JSON file.&nbsp;</div><div><br>I'll need a JSON parser and I definitely don't want to write one myself. The Elixir package manager is called <a href=\"https://hex.pm\">hex</a> (see the first attached screenshot). I'll go there and see if I can find one.&nbsp;</div><div><br></div><div>After a quick search I found a JSON parser called <span style=\"font-family: Courier;\">Jason</span> (see the second attached screenshot).&nbsp;</div><div><br></div><div>In order to use this package I need to add it to my dependencies in the <span style=\"font-family: Courier;\">mix.exs</span> file. This tells Mix to download the package and copy it to a directory called <span style=\"font-family: Courier;\">deps</span>.</div><div><br></div><div>In order to actually download the code into the Mix directory I execute this command:</div><div><br></div><div><span style=\"font-family: Courier;\">mix deps.get</span><br></div><div><br></div><div>The third attached screenshot shows the output after executing the command. This downloads the code in to the <span style=\"font-family: Courier;\">deps</span> directory but does not compile it (I am leaving this directory out of the playback too).</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-3","selectedText":"{:jason, \"~> 1.3\"}","startRow":23,"startColumn":6,"endRow":23,"endColumn":24}],"imageURLs":["media/images/1662347440000-07.png","media/images/1662347440000-08.png","media/images/1662347440000-09.png"],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":4,"currentFilePath":"/mix.exs","viewableBlogText":"  # Run \"mix help deps\" to learn about dependencies.\n  defp deps do\n    [\n      {:jason, \"~> 1.3\"}\n      # {:dep_from_hexpm, \"~> 0.3.0\"},\n      # {:dep_from_git, git: \"https://github.com/elixir-lang/my_dep.git\", tag: \"0.1.0\"}\n    ]\n  end","commentTags":["image"],"questionCommentData":null}],"ev-4940":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-4940","timestamp":1662347552791,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":4940,"type":"DELETE","fileId":"fileId-7","character":" ","previousNeighborId":"ev-4634","lineNumber":21,"column":1},"developerGroupId":"devGroupId-2","timestamp":1662347632436,"commentText":"<div>In <span style=\"font-family: Courier;\">NameFormatter</span> I add a couple of functions that take a formatted name and write it to a JSON file.&nbsp;I use the <span style=\"font-family: Courier;\">Jason</span> package I recently downloaded to encode a map. </div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-6","selectedText":"def to_json_file(formatted_name, file_path) do\n    valid_json_string = Jason.encode!(%{formatted_name: formatted_name})\n    handle_file_write(File.write(file_path, valid_json_string))\n  end\n\n  defp handle_file_write(:ok) do\n    #do nothing\n  end\n\n  defp handle_file_write({:error, reason}) do\n    IO.puts(\"Error: #{reason}\")\n  end","startRow":20,"startColumn":2,"endRow":31,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/test/name_formatter_test.exs","viewableBlogText":"  def to_json_file(formatted_name, file_path) do\n    valid_json_string = Jason.encode!(%{formatted_name: formatted_name})\n    handle_file_write(File.write(file_path, valid_json_string))\n  end\n\n  defp handle_file_write(:ok) do\n    #do nothing\n  end\n\n  defp handle_file_write({:error, reason}) do\n    IO.puts(\"Error: #{reason}\")\n  end","commentTags":[],"questionCommentData":null},{"id":"commentId-12","displayCommentEvent":{"id":"ev-4940","timestamp":1662347552791,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":4940,"type":"DELETE","fileId":"fileId-7","character":" ","previousNeighborId":"ev-4634","lineNumber":21,"column":1},"developerGroupId":"devGroupId-2","timestamp":1662352455572,"commentText":"<div>In the test file, <span style=\"font-family: Courier;\">name_formatter_test</span>.exs I add a function to the module <span style=\"font-family: Courier;\">NameFormatterTest</span>. This tests the new function. I write the name to the JSON file and then I read the file and verify that the name is in it.<br></div><div><br></div><div>The first attached screenshot shows what happens when I run the code for the first time. The new files from the <span style=\"font-family: Courier;\">Jason</span> package are compiled.&nbsp;</div><div><br></div><div>The second attached screenshot shows the output the second time I attempt to run the tests. The new files have already been compiled and don't need to be compiled again.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-7","selectedText":"test \"test json file creation\" do\n    file_path = \"test.json\"\n    Part1.NameFormatter.to_json_file(\"Mahoney, Mark R.\", file_path)\n    {:ok, file_contents} = File.read(file_path)\n\n    valid_json_map = Jason.decode!(file_contents)\n    assert(valid_json_map[\"formatted_name\"] == \"Mahoney, Mark R.\")\n  end","startRow":21,"startColumn":2,"endRow":28,"endColumn":5}],"imageURLs":["media/images/1662352143121-10.png","media/images/1662352143121-11.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/test/name_formatter_test.exs","viewableBlogText":"  test \"test json file creation\" do\n    file_path = \"test.json\"\n    Part1.NameFormatter.to_json_file(\"Mahoney, Mark R.\", file_path)\n    {:ok, file_contents} = File.read(file_path)\n\n    valid_json_map = Jason.decode!(file_contents)\n    assert(valid_json_map[\"formatted_name\"] == \"Mahoney, Mark R.\")\n  end","commentTags":["all-tests-pass","image"],"questionCommentData":null}]};
